//target contains [1,2,3,4], iterator pointer after 2
iterator.forEachRemaining(function(item, index) {
  console.log(item*2);
});
// Output: 6 8

//target contains [1,2,3,4] iterator pointer after 3.
if(iterator.hasNext()) console.log("Elements remaining");
//Ouput: Elements remaining

//target contains [1,25,83,48] iterator pointer after 1.
console.log((item = iterator.next());
//Output 25

//target contains [1,25,83,48] iterator pointer after 1.
iterator.next() //returns 25
iterator.remove(); //removes 25
// now target contains [1,83,48]

//target contains [1,5,11,26] and iterator pointer between 11 and 26
iterator.add(25);
//new list contains [1,5,11,25,26]

//target contains [1,2,3,4], iterator pointer after 2
iterator.forEachRemaining(function(item, index) {
  console.log(item*2);
});
// Output: 6 8

//target contains [1,2,3,4] iterator pointer after 3.
if(iterator.hasNext()) console.log("Elements remaining");
//Ouput: Elements remaining

//target contains [1,5,11,26] and iterator pointer before 1
console.log(iterator.hasPrevious());
//Output: false

//target contains [1,5,11,26] and iterator pointer between 5 and 11
console.log(iterator.next());
//Output: 11

//target contains [1,5,11,26] and iterator pointer between 11 and 26
console.log(iterator.nextIndex());
//Output: 3
iterator.next();
console.log(iterator.nextIndex());
//Output: -1

//target contains [1,5,11,26] and iterator pointer between 11 and 26
console.log(iterator.previous());
//Output: 11

//target contains [1,5,11,26] and iterator pointer between 11 and 26
console.log(iterator.previousIndex());
//Output: 2

//target contains [1,5,11,26] and iterator pointer between 5 and 11
iterator.previous(); //returns 5
iterator.remove(); //removes 5
//now target contains [1,11,26]

//target contains [1,5,11,26] and iterator pointer between 5 and 11
iterator.next(); //returns 11
iterator.set(15);
//now target contains [1,5,15,26]

